import "./R4c7Copy.css";

const R4c7Copy = ({ onClose }) => {
  return (
    <div className="r4c7-copy-div">
      <div className="r4c7-content-div">
        <span className="r4c7-content-txt-span">
          <p className="vehicle-garbage-truck6">Vehicle: Garbage Truck 2</p>
          <p className="vehicle-garbage-truck6">Sáng:Route1,MCP2</p>
          <p className="chiu-mcp3">Chiều: MCP3</p>
        </span>
      </div>
      <div className="r4c7-text-div">25</div>
    </div>
  );
};

export default R4c7Copy;
